INSERT INTO `roadshow` VALUES (37,'Konser Terima Kasih Tuhan dan Hujan','Malang','-','2020-06-06','2020-06-06.png','Malang. Menjadi kota pertama untuk tour kali ini. Daerah dataran tinggi yang berada di Jawa Timur. Menjadi tempat yang cocok dengan suasananya untuk mendengarkan lantunan lagu-lagu lembut ala Nosstress.',1500),(38,'Konser Terima Kasih Tuhan dan Hujan','Yogyakarta','-','2020-06-13','2020-06-13.png','Daerah Istimewa Yogyakarta. Menjadi tujuan selanjutnya setelah malang untuk tour bertanuk Tour Terimakasih ini. Selain dikenal dengan kota pendidikan, Yogya juga dikenal dengan kreatifitas serta surganya bagi komunitas. Untuk para fans Nosstress tunggu kedatangan Nosstress beserta rombongan Musikologi Orkestra.',2000),(39,'Konser Terima Kasih Tuhan dan Hujan','Solo','-','2020-06-27','2020-06-27.png','Kota Surakarta/Solo. Berlanjut ketetangga Yogyakarta. Kota batik ini menjadi kota pilihan Tour Terimakasih untuk menyelenggarakan penampilan Nosstress beserta Musikologi Orkestra di Jawa Tengah.',2000),(40,'Konser Terima Kasih Tuhan dan Hujan','Bandung','-','2020-07-25','2020-07-25.png','Bandung. Kota Kembang. Tempat lahirnya banyak musisi dan band-band ternama Indonesia. Tour Terimakasih akan membawa Nosstress dengan versi orkestra untuk menaklukan Bandung dengan penampilan yang tak pernah kalian lihat sebelumnya.',1000),(41,'Konser Terima Kasih Tuhan dan Hujan','Jakarta','-','2020-08-22','2020-08-22.png','Jakarta, kami pulang. Tour Terimakasih akan ditutup di Jakarta. Kalian yang selalu menanti Musikologi untuk menyaksikan Nosstress datang ke Jakarta, kali ini kalian tak boleh melewatkan penampilan Nosstress dengan versi orkestra.',2000);
/*!40000 ALTER TABLE `roadshow` ENABLE KEYS */;

